    "from sklearn.preprocessing import StandardScaler\n",
    "from sklearn.cluster import KMeans\n",
    "\n",
    "# Clustering \n",
    "if len(df_clean) > 10:  \n",
    "    try:\n",
    "        # Select features for clustering\n",
    "        cluster_features = [col for col in ['Bedrooms', 'Bathrooms', 'Size_in_sq_m', 'Listed_Price_NGN']\n",
    "                            if col in df_clean.columns]\n",
    "\n",
    "        if len(cluster_features) >= 2:  # Need at least 2 features for clustering\n",
    "            features = df_clean[cluster_features]\n",
    "            \n",
    "            # Normalize the features\n",
    "            scaler = StandardScaler()\n",
    "            scaled_features = scaler.fit_transform(features)\n",
    "            \n",
    "            # KMeans clustering\n",
    "            n_clusters = min(4, len(df_clean) // 3)  # Ensure reasonable cluster count\n",
    "            kmeans = KMeans(n_clusters=n_clusters, random_state=42)\n",
    "            df_clean['Cluster'] = kmeans.fit_predict(scaled_features)\n",
    "            \n",
    "            # Define cluster labels\n",
    "            Cluster_Labels = {\n",
    "                0: 'Budget Properties',\n",
    "                1: 'Standard Properties', \n",
    "                2: 'Premium Properties',\n",
    "                3: 'Luxury Properties'\n",
    "            }\n",
    "            # Map clusters to labels (only for existing clusters)\n",
    "            existing_clusters = df_clean['Cluster'].unique()\n",
    "            relevant_labels = {k: v for k, v in Cluster_Labels.items() if k in existing_clusters}\n",
    "            df_clean['Cluster_Label'] = df_clean['Cluster'].map(relevant_labels)\n",
    "            \n",
    "            print(f\"\\nClustering completed with {n_clusters} clusters\")\n",
    "            print(\"Cluster distribution:\")\n",
    "            print(df_clean['Cluster_Label'].value_counts())\n",
    "        else:\n",
    "            print(\"Not enough numeric features for clustering.\")\n",
    "    \n",
    "    except Exception as e:\n",
    "        print(f\"Clustering failed: {e}\")\n",
    "else:\n",
    "    print(\"Not enough rows for clustering.\")\n",
    "\n"
