    "from sklearn.linear_model import LinearRegression\n",
    "from sklearn.model_selection import train_test_split\n",
    "from sklearn.ensemble import RandomForestRegressor\n",
    "from sklearn.metrics import mean_absolute_error, mean_squared_error\n",
    "import pandas as pd\n",
    "import numpy as np\n",
    "\n",
    "# Predictive Modeling\n",
    "try:\n",
    "    print(\"\\n=== PREDICTIVE MODELING ===\")\n",
    "\n",
    "    # Prepare data\n",
    "    modeling_df = df_clean.copy()\n",
    "\n",
    "    # Categorical encoding\n",
    "    categorical_columns = [\n",
    "        'City', 'Neighborhood', 'Property_Type', 'Has_Generator',\n",
    "        'Has_Borehole', 'Gated_Estate', 'Cluster_Label', 'Size_Band', 'Cluster'\n",
    "    ]\n",
    "\n",
    "    # One-hot encoding\n",
    "    df_encoded = pd.get_dummies(modeling_df, columns=categorical_columns, drop_first=True)\n",
    "\n",
    "    # Check that target column exists\n",
    "    if 'Listed_Price_NGN' in df_encoded.columns:\n",
    "        # Feature selection\n",
    "        X = df_encoded.drop(columns=['Listed_Price_NGN', 'Property_ID'], errors='ignore')\n",
    "        y = df_encoded['Listed_Price_NGN']\n",
    "\n",
    "        # Ensure all features are numeric\n",
    "        non_numeric_columns = X.select_dtypes(include='object').columns\n",
    "        if len(non_numeric_columns) > 0:\n",
    "            raise ValueError(f\"Non-numeric columns in features: {list(non_numeric_columns)}\")\n",
    "\n",
    "        # Train-test split\n",
    "        test_size = min(0.2, max(0.1, len(X) * 0.2 / len(X)))  # Dynamic test size\n",
    "        X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=test_size, random_state=42)\n",
    "\n",
    "        print(f\"Training set size: {len(X_train)}\")\n",
    "        print(f\"Test set size: {len(X_test)}\")\n",
    "\n",
    "        # Define models\n",
    "        models = {\n",
    "            \"Linear Regression\": LinearRegression(),\n",
    "            \"Random Forest\": RandomForestRegressor(random_state=42)\n",
    "        }\n",
    "\n",
    "        # Train and evaluate models\n",
    "        for name, model in models.items():\n",
    "            print(f\"\\nTraining {name}...\")\n",
    "            model.fit(X_train, y_train)\n",
    "            y_pred = model.predict(X_test)\n",
    "\n",
    "            mae = mean_absolute_error(y_test, y_pred)\n",
    "            rmse = np.sqrt(mean_squared_error(y_test, y_pred))\n",
