    "from sklearn.ensemble import RandomForestRegressor\n",
    "from sklearn.model_selection import GridSearchCV\n",
    "from sklearn.metrics import mean_absolute_error, mean_squared_error\n",
    "import numpy as np\n",
    "\n",
    "# Lightweight hyperparameter grid (8 combos × 3 CV = 24 fits)\n",
    "param_grid = {\n",
    "    \"n_estimators\": [200, 500],       # fewer options\n",
    "    \"max_depth\": [None, 20],          # shallower tree options\n",
    "    \"min_samples_split\": [2],         # fixed\n",
    "    \"min_samples_leaf\": [1, 2]        # small variations\n",
    "}\n",
    "\n",
    "# Set up GridSearchCV\n",
    "grid = GridSearchCV(\n",
    "    estimator=RandomForestRegressor(random_state=42),\n",
    "    param_grid=param_grid,\n",
    "    cv=3,\n",
    "    scoring='neg_mean_absolute_error',\n",
    "    n_jobs=-1,\n",
    "    verbose=1\n",
    ")\n",
    "\n",
    "# Fit the model\n",
    "print(\"Tuning Random Forest with Lightweight GridSearchCV …\")\n",
    "grid.fit(X_train, y_train)\n",
    "\n",
    "# Best model and evaluation\n",
    "best_model = grid.best_estimator_\n",
    "\n",
    "y_pred_best = best_model.predict(X_test)\n",
    "mae_best = mean_absolute_error(y_test, y_pred_best)\n",
    "rmse_best = np.sqrt(mean_squared_error(y_test, y_pred_best))\n",
    "\n",
    "print(\"\\nTuned RF – Test Set Performance\")\n",
    "print(f\"MAE : {mae_best:,.2f}\")\n",
    "print(f\"RMSE: {rmse_best:,.2f}\")\n",
    "\n",
    "print(\"\\nBest Hyperparameters:\")\n",
    "for param, value in grid.best_params_.items():\n",
